import React from 'react';
import PropTypes from 'prop-types';
import SwipeableViews from 'react-swipeable-views';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import PhoneIcon from '@material-ui/icons/Phone';
import FavoriteIcon from '@material-ui/icons/Favorite';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import Paper from '@material-ui/core/Paper';
import List from '@material-ui/core/List';
function TabPanel(props) {
  // const { children, content, value, index, ...other } = props;
  return (
    <Box >
    {/* <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    > */}
      {props.content.map( (text)=>(
        <orderList shopname={text.name} shopstate={text.state}/>
      )

      )}
    {/* </Typography> */}
    </Box>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `full-width-tab-${index}`,
    'aria-controls': `full-width-tabpanel-${index}`,
  };
}
function orderList(props){
  const classes = useStyles();
  return(
    <Paper className={classes.paper}>
      <List display='flex' style={{position:'relative',top:50}}>
        <Typography noWrap><PhoneIcon fontSize='small'/>{props.shopname}</Typography>
        <Typography noWrap>{props.shopstate}</Typography>
      </List>
    </Paper>
  );
}

const useStyles = makeStyles(theme => ({
  root: {
    backgroundColor: theme.palette.background.paper,
    width: '100%',
    marginLeft:10,
  },
  paper: {
    padding: theme.spacing(3, 2),
  },
  
}));

var content1 = {name:'潇湘药房',state:'交易成功'}

export default function FullWidthTabs() {
  const classes = useStyles();
  const theme = useTheme();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChangeIndex = index => {
    setValue(index);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="default" >
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="standard"
          aria-label="full width tabs example"
        >
        <Tab icon={<PhoneIcon />} label="待付款" {...a11yProps(0)}/>
        <Tab icon={<FavoriteIcon />} label="待发货" {...a11yProps(1)} />
        <Tab icon={<PersonPinIcon />} label="待收货" {...a11yProps(2)} />
        <Tab icon={<PersonPinIcon />} label="待评价" {...a11yProps(2)} />
        <Tab icon={<PersonPinIcon />} label="退款" {...a11yProps(2)} />
         
        </Tabs>
      </AppBar>
      <SwipeableViews
        axis={theme.direction === 'rtl' ? 'x-reverse' : 'x'}
        index={value}
        onChangeIndex={handleChangeIndex}
      >
        <TabPanel value={value} index={0} dir={theme.direction}>
          {value}
        </TabPanel>
        <TabPanel value={value} index={1} content={content1} dir={theme.direction}>
          <orderList/>2
        </TabPanel>
        <TabPanel value={value} index={2} dir={theme.direction}>
          Item Three
        </TabPanel>
        <TabPanel value={value} index={3} dir={theme.direction}>
          Item Three
        </TabPanel>
        <TabPanel value={value} index={4} dir={theme.direction}>
          Item Three
        </TabPanel>
      </SwipeableViews>
    </div>
  );
}
